    /**
     * @var array<int,array>
     */
    private static array $region_cache = [];

    /**
     * @return array<int,array>
     */
    public static function getRegionsList(): array
    {
        if (!empty(self::$region_cache)) {
            return self::$region_cache;
        }

        foreach (self::JSON as $items) {
            $ids = array_column($items, 'id');
            $items_with_ids = array_combine($ids, $items);
            self::$region_cache = self::$region_cache + $items_with_ids;
        }
        return self::$region_cache;
    }

    /**
     * Возвращает список регионов по указанному типу
     *
     * @param string $type Тип из констант TYPE_...
     *
     * @return array|array[]
     */
    public static function getRegionsByType(string $type): array
    {
        $items = self::JSON[$type] ?? [];
        if (empty($items)) {
            return $items;
        }

        $ids = array_column($items, 'id');
        $items = array_combine($ids, $items);

        return $items === false
            ? []
            : $items
        ;
    }

    /**
     * Возвращает список регионов по указанному level
     *
     * @param int $level
     *
     * @return array
     */
    public static function getRegionsByLevel(int $level): array
    {
        if ($level < 1 || $level > 3) {
            return [];
        }

        $list = self::getRegionsList();

        return array_filter($list, function ($region) use ($level) {
            /**
             * @psalm-suppress MixedArrayAccess
             */
            return ($region['level'] ?? null) == $level;
        });
    }

    /**
     * Возвращает список регионов дочерних указанному
     *
     * @param int $parent_id Id родительского региона
     *
     * @return array
     */
    public static function getRegionsByParentId(int $parent_id): array
    {
        $list = self::getRegionsList();
        return array_filter($list, function ($region) use ($parent_id) {
            /**
             * @psalm-suppress MixedArrayAccess
             */
            return ($region['parent_id'] ?? null) == $parent_id;
        });
    }

    /**
     * Возвращает регион по ID
     *
     * @param int $id Id региона
     *
     * @return ?array
     */
    public static function getRegionById(int $id): ?array
    {
        self::getRegionsList();

        return self::$region_cache[$id] ?? null;
    }

    /**
     * Возвращает тип региона
     *
     * @param int $id Id региона
     *
     * @return string|null
     */
    public static function getRegionType(int $id): ?string
    {
        $region = self::getRegionById($id);
        if (is_null($region)) {
            return null;
        }

        foreach (self::JSON as $type => $items) {
            $ids = array_column($items, 'id');
            if (in_array($id, $ids)) {
                return $type;
            }
        }
        return null;
    }

    /**
     * Возвращает массив всех родительских регионов и самого региона скруппированных по типу
     *
     * @param int $id Id региона
     *
     * @return array[]
     */
    public static function getRegionTree(int $id): array
    {
        $region = self::getRegionById($id);
        $type = self::getRegionType($id);

        if ($region === null || $type === null) {
            throw new \InvalidArgumentException('Invalid region ID.');
        }

        $tree = [$type => $region];

        if (isset($region['parent_id'])) {
            /**
             * @psalm-suppress MixedArgument
             */
            $tree = array_merge($tree, self::getRegionTree($region['parent_id']));
        }

        uasort($tree, function (array $a, array $b) {
            if ($a['level'] == $b['level']) {
                return 0;
            }
            return ($a['level'] < $b['level']) ? -1 : 1;
        });

        return $tree;
    }
